&lt;p&gt;&lt;a href="http://www.flickr.com/people/eertrj/"&gt;eertrj&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/eertrj/5251442203/" title="Barracuda"&gt;&lt;img src="http://farm6.static.flickr.com/5010/5251442203_49b263bcd3_m.jpg" width="240" height="159" alt="Barracuda" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Probably got the species name wrong. It's difficult to get the focus right in low light.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/eertrj/"&gt;eertrj&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/eertrj/5251909735/" title="Sea Anemone"&gt;&lt;img src="http://farm6.static.flickr.com/5289/5251909735_0e767f1953_m.jpg" width="159" height="240" alt="Sea Anemone" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Exotic creature of the sea.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/eertrj/"&gt;eertrj&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/eertrj/5251909831/" title="Caribbean Flamingo"&gt;&lt;img src="http://farm6.static.flickr.com/5283/5251909831_d03e43d460_m.jpg" width="159" height="240" alt="Caribbean Flamingo" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;I thought flamingos live only in Africa, apparently they are in the Caribbean as well.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/eertrj/"&gt;eertrj&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/eertrj/5251911033/" title="Manta"&gt;&lt;img src="http://farm6.static.flickr.com/5127/5251911033_b8b7621a55_m.jpg" width="240" height="58" alt="Manta" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Should have tried to capture the roller coaster in this.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/eertrj/"&gt;eertrj&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/eertrj/5252046692/" title="Trees on the Lake"&gt;&lt;img src="http://farm6.static.flickr.com/5001/5252046692_922bb95d73_m.jpg" width="240" height="41" alt="Trees on the Lake" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;The weather was a bit chill, but at least the sky was blue&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/eertrj/"&gt;eertrj&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/eertrj/5252047060/" title="Tawny Frogmouth"&gt;&lt;img src="http://farm6.static.flickr.com/5167/5252047060_d6736b420c_m.jpg" width="159" height="240" alt="Tawny Frogmouth" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Aussie animals are cute, but they also look sleepy. Perhaps I should move to Australia.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/rustyboxcars/"&gt;Rusty Boxcars&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/rustyboxcars/5260822078/" title="Seaworld Christmas"&gt;&lt;img src="http://farm6.static.flickr.com/5282/5260822078_3cf21e1712_m.jpg" width="240" height="149" alt="Seaworld Christmas" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;A cute little street show at seaworld.&lt;br /&gt;
this is why guys should never wrap gifts!&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/gill_mc/"&gt;Gill_:0)&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/gill_mc/5260963706/" title="Fireworks"&gt;&lt;img src="http://farm6.static.flickr.com/5203/5260963706_1088e099c8_m.jpg" width="240" height="190" alt="Fireworks" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;End of the day firework display at SeaWorld, Orlando, Florida.&lt;/p&gt;
